import React, { useState } from 'react';
import CustomBtn from '../../Components/CustomeBtn/CustomBtn';
import { Tabs } from '../../Components/StyledComponents/Index';
import Logo from '../../Components/Images/Logo1.png'
import { SlEnvolope, SlCalender, SlSettings } from "react-icons/sl";
import Forums from '../../Components/Images/Forums.png'


const NavTab = () => {
    return (
        <Tabs className='w-[10%] items-center bg-[#0cf03d]'>
            <img src={Logo} className='font-medium w-[50%]'/>
            <div className='bg-blue mt-10 flex items-center justify-center'>
                <ul className='flex items-center justify-center flex-col gap-8 cursor-pointer'>
                    <li className='text-center justify-center'>
                        <SlEnvolope className='ml-[40%]'/>
                        <small>Messages</small>
                    </li>
                    <li className='text-center justify-center'>
                        <SlCalender className='ml-[40%]'/>
                        <small>Schedule</small>
                    </li>
                    <li className='text-center justify-center' title='Forums'>
                        <img src={Forums} className='ml-[40%] w-[25%]'/>
                        <small>Forums</small>
                    </li>
                </ul>
            </div>
            <div className='mt-[20rem] items-center justify-center flex flex-col w-[100%] p-2 cursor-pointer'>
                <SlSettings/>
                <small>Settings</small>
            </div>

            
        </Tabs>
    );
};

const ChatsProfileTabs = ({ showPeopleList }) => {
    return (
        <Tabs className='bg-[green] w-[25%]'>
            <p>Chats Profile</p>
        </Tabs>
    );
};

const ChatsTabs = () => {
    return (
        <Tabs className='bg-[red] w-[50%]'>
            <p>Chats</p>
        </Tabs>
    );
};

const ProfileTab = () => {
    return (
        <Tabs className='bg-[blue] w-[25%]'>
            <p>Profile</p>
        </Tabs>
    );
};

const Main = () => {
    return (
        <div className='flex flex-col items-center h-screen'>
        <div className='flex items-center w-[75%]'>
            <NavTab/>
            <ChatsProfileTabs/>
            <ChatsTabs />
            <ProfileTab />
        </div>
        </div>
    );
};

export default Main;
